  data = `
RootNote:
  name: null
  completed: null
  children:
    - name: Note1
      note: null
      completed: false
      children: []
    - name: Note2
      note: Note2 Note
      completed: true
      children:
        - name: Note2a
          note: null
          completed: false
          children: []
        - name: Note2b
          note: null
          completed: false
          children: []
`;

  constructor(props) {
    super(props);

    this.json = yaml.load(this.data);
    this.selected = {};
  }

